var swiper=new Swiper(".gallery",{slidesPerView:6,spaceBetween:17,freeMode:!0,navigation:{nextEl:".swiper-button-next",prevEl:".swiper-button-prev"},mousewheel:!0,keyboard:!0});const smoothLinks=document.querySelectorAll('a[href^="#"]');for(let e of smoothLinks)e.addEventListener("click",(function(t){t.preventDefault();const o=e.getAttribute("href");document.querySelector(o).scrollIntoView({behavior:"smooth",block:"start"})}));